column8:
まるで猫がおしゃべりしているようなキーホルダー。<br>
吹き出しパーツに名入れができるのでプレゼントにも最適です。<br><br>
●Size: ねこ:横3.5cm　高さ9cm<br>
フラワー:1.5cm<br>
吹き出し:横3.5cm　高さ2.5cm<br>
（画像参照）<br>
●Material : 本革（プレーン、エナメル）、スワロフスキー<br>
●Attention: made in japan<br>
<br>※在庫がない場合は、お届け時間に一週間程度かかる場合もございますので、ご了承下さい。
